import "./ExpenseItem.css";

function ExpenseItem() {
	const expenes = [
		["4th March, 2023", "Car Insurance", "$35.99"],
		["4th March, 2023", "Car Insurance", "$35.99"],
		["4th March, 2023", "Car Insurance", "$35.99"],
	];
	expenes.map((item) => {
		return (
			<div className="expense-item">
				<div>{item[0]}</div>
				<div className="expense-item__description">
					<h2>{item[1]}</h2>
                    <div className="expense-item__price">{item[2]}</div>
				</div>
			</div>
		);
	});
}

export default ExpenseItem;
